import {Exp} from '../kernel_names';
import {GradConfig} from '../kernel_registry';
import {mul} from '../ops/mul';
import {Tensor} from '../tensor';

export const expGradConfig: GradConfig = {
  kernelName: Exp,
  outputsToSave: [true],
  gradFunc: (dy: Tensor, saved: Tensor[]) => {
    const [y] = saved;
    return {x: () => mul(dy, y)};
  }
};
